import { Route } from 'react-router';
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Switch} from 'react-router-dom';
function App() {
  return (
    <>

    <Router>
    <Navbar/>
     <Switch>
       <Route path='/' />
     </Switch>
    </Router>
    </>
  );
}

export default App;
